const data = [
    {
        path : 'userAdd',
        name : 'إضافة مستخدم',
        icon : 'fa-solid fa-user-plus'
    },
    {
        path : 'userUpdate',
        name : 'تعديل مستخدم',
        icon : 'fa-solid fa-user-pen'
    },
    {
        path : 'userDelete',
        name : 'حذف مستخدم',
        icon : 'fa-solid fa-user-xmark'
    },
    {
        path : 'usersShow',
        name : 'عرض المستخدمين',
        icon : 'fa-solid fa-users'
    },
    {
        path : 'monyTransfer',
        name : 'تحويل الأموال',
        icon : 'fa-solid fa-arrow-up-from-bracket'
    },
    {
        path : 'ي',
        name : 'تحويل الأموال',
        icon : 'fa-solid fa-arrow-up-from-bracket'
    },
    // {
    //     path : '/',
    //     name : 'تسجيل الخروج',
    //     icon : 'fa-solid fa-arrow-right-from-bracket'
    // },
]
export default data
